import React from 'react'
import './clusterMessage.component.scss'
import Button from '../button/button.component'
import { motion } from "framer-motion"

export default function ClusterMessage(props) {
    const variants = {
        initial: { opacity: 0, y: 100 },
        actual: { opacity: 1, y: 0 },
    }

    return (
        <div className="cluster-message" style={props.style}>
            <motion.h1 initial="initial" animate="actual" variants={variants} transition={{ ease: "easeIn", duration: 3 }}>materiale de contructii, gradinarit & bricolaj</motion.h1>
            <p>Nu ai gasit ce cautai?</p>
            <p>Preluam si comenzi speciale</p>
            <p>Apeleaza-ne la 0732 409 095</p>
            <Button/>
        </div>
    )
}
